import Container from "./components/Container";
import Head from "next/head";
const About = () => {
  return (
    <Container>
      <Head>
        <title>Next.js Project - About</title>
      </Head>
      <h1>About</h1>
      <p>
        Lorem, ipsum dolor sit amet consectetur adipisicing elit. Ab nostrum,
        laborum pariatur esse facere error officia aliquid deserunt possimus
        dicta praesentium, vero iure distinctio. Qui necessitatibus mollitia
        expedita vitae earum!
      </p>
    </Container>
  );
};

export default About;
